mxCell.value:
fCurrentPowerConsumptionPlants = 0;
for iPlant = 1:length(this.csPlants)
  for iSubculture = 1:this.miSubcultures(iPlant)
    sCultureName = [this.csPlants{iPlant},'_', num2str(iSubculture)];

    fCurrentPowerConsumptionPlants = fCurrentPowerConsumptionPlants + this.toChildren.(sCultureName).fPower;
  end
end

% The consumed power must also be modelled as produced heat in
% the corresponding air phases. For the greenhouse, we assume
% 20% of the power consumption to be heat
this.toStores.Cabin.toPhases.Atmosphere.oCapacity.toHeatSources.CabinHeatSource.setHeatFlow(0.2 * fCurrentPowerConsumptionPlants);
